message:
  @所有人?友情提示：
6月24日下午2:00-3:00在政通路305弄19号建新活动室可接种新冠疫苗（一、二、三针皆可），有需要的居民请带好身份证前往，请大家互相转告！

温馨提醒:接种新冠疫苗后48小时内不可做核酸检测??

  @所有人??
??紧急通知：
受外区疫情影响，今晚全区进行全员核酸筛查，开始时间暂未定。

  @八爷? 602室 接到通知:
  你们两明天早上的核酸大筛查不能参加的。
  请谅解[抱拳]

  @所有人?7月19日（今日）在建新居委活动室（政通路305弄19号）设立新冠疫苗接种点，接种时间为晚上18:00--19:30（留观至20:00时），第一、二、三针皆可接种，请居民们相互转告，谢谢。
温馨提醒:接种新冠疫苗后48小时内不可做核酸检测！！！
另：????本周二、四、六晚间常态化核酸检测点暂停开放，望周知！

  @所有人?
【预通知】
7月27日-7月29日将开展抗原+核酸筛查， 白天抗原+晚上大筛，继续做三天，每晚从18点开始到核酸结果出来前，小区封闭管理，大筛第二天凭24小时核酸阴性证明出小区。

