  @所有人?                                                                温馨提示

       据气象部门预测，今年11号台风“轩岚诺”来临,为了尽可能减少损失,防患于未然,温馨提醒大家,出门时关好门窗,注意人身安全。将阳台上易落的物品摆放至安全位置,并检查自家安装在户外的晒衣架、花架、遮阳棚、空调外机等构筑物是否牢固,并安善保管好自家财物。
谢谢您的配合!

  @所有人?现暂定于明天（10月23日）早上7:30小区核酸大筛??请大家耐心等待志愿者大喇叭喊楼。
